function _normalize(vec) {
  var output = {
    x: vec.x,
    y: vec.y,
    z: vec.z
  };
  var dx = vec.x * vec.x;
  var dy = vec.y * vec.y;
  var dz = vec.z * vec.z;
  var dis = Math.sqrt(dx + dy + dz);
  if (dis > 0) {
    output.x /= dis;
    output.y /= dis;
    output.z /= dis;
  }
  return output;
}

function setMaterials(material) {
  if (material) {
    scene.traverse(function(node) {
      if (node instanceof THREE.Mesh && !node._unreal) {
        node.material = material;
      }
    });
  } else {
    scene.traverse(function(node) {
      if (node instanceof THREE.Mesh && !node._unreal) {
        node.material = node._material;
      }
    });
  }
}

function setUniforms() {
  // console.log(camera.position.x, camera.position.y, camera.position.z);
  var currentTime = (Date.now() - startTime) / 1000.0;
  filterQuadMaterial.uniforms.fHide.value = Math.max(2.65 - Math.pow(currentTime, 1.0) * 2.0, 0.0);
  filterQuadMaterial.uniforms.fTime.value = currentTime;
  accumulationQuadMaterial.uniforms.fFocalLength.value = cameraOffset.focalLength;
  accumulationQuadMaterial.uniforms.fTime.value = currentTime;

  scene.traverse(function(node) {
    if (node instanceof THREE.Mesh) {
      if (node.material.uniforms && node.material.uniforms.fTime) {

        node.material.uniforms.fTime.value = currentTime;

      }
    }
  });
  quadScene.traverse(function(node) {
    if (node instanceof THREE.Mesh) {
      if (node.material.uniforms && node.material.uniforms.fTime) {

        node.material.uniforms.fTime.value = currentTime;

      }
    }
  });
}

function _updateCameraOffset() {
  var focalSpeed = 10.0;
  cameraOffset.x = cameraOffset.x * 0.8 + cameraTarget.x * 0.2;
  cameraOffset.y = cameraOffset.y * 0.8 + cameraTarget.y * 0.2;
  cameraOffset.z = cameraOffset.z * 0.8 + cameraTarget.z * 0.2;
  var dFocalLength = cameraTarget.focalLength - cameraOffset.focalLength;
  if (Math.abs(dFocalLength) < focalSpeed) {
    cameraOffset.focalLength = cameraTarget.focalLength;
  } else {
    cameraOffset.focalLength += focalSpeed * Math.sign(dFocalLength);
  }
}

function _updateMinDistance() {
  var minDis = 100000;
  var minDisSamples = 1;
  var minDisSampleSize = 0.5 * 0.0;
  for (var i = 0; i < minDisSamples; i++) {
    for (var j = 0; j < minDisSamples; j++) {
      rayOrigin.x = (i / minDisSamples - 0.5) * minDisSampleSize * 2.0;
      rayOrigin.y = (j / minDisSamples - 0.5) * minDisSampleSize * 2.0;
      rayOrigin.y -= 0.25;
      raycaster.setFromCamera(rayOrigin, camera);
      var intersects = raycaster.intersectObjects(scene.children, true);
      for (var d = 0; d < intersects.length; d++) {
        minDis = Math.min(intersects[d].distance, minDis);
      }
    }
  }
  if (minDis > 1000) {
    cameraTarget.focalLength = 0.0;
  } else {
    cameraTarget.focalLength = minDis;
  }
}

