function _animate() {
  var currentFPS = 1000 / (Date.now() - frameTime);
  fpsAvg = fpsAvg * 0.98 + currentFPS * (1.0 - 0.98);
  $('#fps').text(fpsAvg.toFixed(0));
  frameTime = Date.now();
  var isStatic = true;
  // if (frameCounter == 1) {
  //   camera.updateMatrixWorld(true);
  //   motionMaterial.uniforms.mLastFrame.value.copy(camera.matrixWorldInverse);
  // }
  // phoneScreen.needsUpdate = true;
  if (POST_PROCESSING) {
    motionMaterial.uniforms.mLastFrame.value.copy(camera.matrixWorldInverse);
  }
  _updateCameraOffset();
  // camera.position.set(cameraPosition.x + cameraOffset.x, cameraPosition.y + cameraOffset.y, cameraPosition.z + cameraOffset.z);
  var cs = 0.05;
  cameraOffset.x = Math.sin(frameCounter * cs + 0.8) * 200 * 3;
  cameraOffset.z = Math.cos(frameCounter * cs + 0.8) * 200 * 3;
  cameraOffset.y = 50 * 3;
  // camera.position.set(cameraOffset.x, cameraOffset.y, cameraOffset.z);
  isStatic = isStatic && (Math.abs(lastCameraPosition.x - camera.position.x) < EPS);
  isStatic = isStatic && (Math.abs(lastCameraPosition.y - camera.position.y) < EPS);
  isStatic = isStatic && (Math.abs(lastCameraPosition.z - camera.position.z) < EPS);
  isStatic = isStatic && (Math.abs(lastCameraPosition.focalLength - cameraOffset.focalLength) < EPS);
  lastCameraPosition = camera.position.clone();
  lastCameraPosition.focalLength = cameraOffset.focalLength;
  control.update();
  camera.updateProjectionMatrix();



  // motionMatrix.multiplyMatrices(camera.projectionMatrix, camera.matrixWorldInverse);
  // motionMatrix.multiplyMatrices(motionMatrix, phoneObj.matrixWorld);
  if (POST_PROCESSING) {
    // fb.needsUpdate = true;
    // update raycasting
    _updateMinDistance();
    setMaterials();
    var sp = samplePos[frameCounter % TEMPORAL_SAMPLES];
    var dx = 1 / bufferWidth * (sp.x + Math.random() / TEMPORAL_SAMPLE_SIDE * 2.0);
    var dy = 1 / bufferHeight * (sp.y + Math.random() / TEMPORAL_SAMPLE_SIDE * 2.0);
    // var dx = 1 / bufferWidth * (Math.random() * 2.0 - 1);
    // var dy = 1 / bufferHeight * (Math.random() * 2.0 - 1);
    // accumulationQuadMaterial.uniforms.fJitter.value = (Math.random() + Math.random() + Math.random() + Math.random() + Math.random()) / 5 * 2 - 0.5;

    var radialDither = Math.random();
    var angularDither = Math.random();
    for (var i = 0; i < 8; i++) {
      var bp = bokehPos[(frameCounter * 8 + i) % bokehPos.length];
      var per = i / 8;
      var r = Math.sqrt((i + radialDither) / 8);
      var ang = Math.PI * 2.0 * per + Math.PI * 2.0 * angularDither;
      bp.x = Math.cos(ang) * r;
      bp.y = Math.sin(ang) * r;
      bokehArray[i * 2] = bp.x / bufferWidth * MAX_COC;
      bokehArray[i * 2 + 1] = bp.y / bufferHeight * MAX_COC;
    }

    accumulationQuadMaterial.uniforms.mBokeh.value.fromArray(bokehArray);

    // accumulationQuadMaterial.uniforms.fJitter.value = (Math.random() + Math.random()) - 0.5;
    setUniforms();
    accumulationQuadMaterial.uniforms.vBokehSize.value.x = 1 / bufferWidth * MAX_COC;
    accumulationQuadMaterial.uniforms.vBokehSize.value.y = 1 / bufferHeight * MAX_COC;
    accumulationQuadMaterial.uniforms.vInverseBufferSize.value.x = 1 / bufferWidth;
    accumulationQuadMaterial.uniforms.vInverseBufferSize.value.y = 1 / bufferHeight;
    accumulationQuadMaterial.uniforms.vJitterOffset0.value.x = dx;
    accumulationQuadMaterial.uniforms.vJitterOffset0.value.y = dy;
    filterQuadMaterial.uniforms.vInverseBufferSize.value.x = 1 / bufferWidth;
    filterQuadMaterial.uniforms.vInverseBufferSize.value.y = 1 / bufferHeight;

  }
  renderer.setClearColor(env.background);
  backgroundMesh.material.color.set(env.background);
  if (POST_PROCESSING) {

    // render the scene to sceneTexture at full resolution
    camera.projectionMatrix.elements[2 * 4 + 0] += dx;
    camera.projectionMatrix.elements[2 * 4 + 1] += dy;
    renderer.clearTarget(textures.sceneTexture);
    renderer.render(scene, camera, textures.sceneTexture, false);

    if (frameCounter == 0) {
      motionMaterial.uniforms.mLastFrame.value.copy(camera.matrixWorldInverse);
    }

    // render the motion buffer
    camera.projectionMatrix.elements[2 * 4 + 0] -= dx;
    camera.projectionMatrix.elements[2 * 4 + 1] -= dy;
    renderer.setClearColor(0x8080ff);
    setMaterials(motionMaterial);
    backgroundMesh.material.color.set(0x8080ff);
    renderer.clearTarget(textures.motionTexture);
    renderer.render(scene, camera, textures.motionTexture, false);

    // render to the accumulation buffer
    renderer.setClearColor(0x000000, 0.0);
    renderer.clearTarget(textures.accumulationInputTexture);
    quad.material = accumulationQuadMaterial;

    if (!isStatic) {
      resetFrame = frameCounter;
    }
    currentAlpha = Math.min(1.0 - 1.0 / (frameCounter - resetFrame + 1.0), TEMPORAL_ALPHA);
    accumulationQuadMaterial.uniforms.fAlpha.value = currentAlpha;

    renderer.render(quadScene, quadCamera, textures.accumulationInputTexture, false);

    // render the final results to next frames accumulation buffer and the screen
    // renderer.clearTarget(textures.accumulationOutputTexture);
    simpleQuadMaterial.uniforms.tOutput.value = textures.accumulationInputTexture.texture;
    quad.material = simpleQuadMaterial;
    renderer.render(quadScene, quadCamera, textures.accumulationOutputTexture, false);
    if (MOTION_BLUR) {
      quad.material = filterQuadMaterial;
    } else {
      colorFilterQuadMaterial.uniforms.tOutput.value = textures.accumulationInputTexture.texture;
      quad.material = colorFilterQuadMaterial;
    }
    renderer.render(quadScene, quadCamera);

  } else {
    renderer.clear();
    renderer.render(scene, camera);
  }

  frameCounter++;
  setTimeout(function() {
    requestAnimationFrame(_animate);
  }, framePeriod);
}

