materials.diffuseFragment = function(environment, diffuseColor) {
  var result = '';
  result += 'vec3 diffuseColor = vec3(' + diffuseColor.r.toFixed(6) + ', ' + diffuseColor.g.toFixed(6) + ', ' + diffuseColor.b.toFixed(6) + ');\n';
  for (var i = 0; i < environment.length; i++) {
    var light = environment[i];
    var position = _normalize(light.position);
    result += '  dp = dot(vN, vec3(' + position.x.toFixed(6) + ', ' + position.y.toFixed(6) + ', ' + position.z.toFixed(6) + '));\n';
    result += '  theta = acos(dp);';
    // result += '  diffuse += ' + light.power.toFixed(6) + ' * max(cos(max(acos(dp) - ' + light.radius.toFixed(6) + ', 0.0)), 0.0) * vec3(' + light.color.r.toFixed(6) + ', ' + light.color.g.toFixed(6) + ', ' + light.color.b.toFixed(6) + ') * vec3(' + diffuseColor.r.toFixed(6) + ', ' + diffuseColor.g.toFixed(6) + ', ' + diffuseColor.b.toFixed(6) + ');\n';
    result += '  diffuse += light_' + i + '_0(theta) * ' + light.power.toFixed(6) + ' * vec3(' + light.color.r.toFixed(6) + ', ' + light.color.g.toFixed(6) + ', ' + light.color.b.toFixed(6) + ') * diffuseColor;';
  }
  return result;
};

materials.reflectiveFragment = function(environment, reflectionColor, octave) {
  var result = '';
  for (var i = 0; i < environment.length; i++) {
    var light = environment[i];
    var position = _normalize(light.position);
    result += '  dp = dot(vR, vec3(' + position.x.toFixed(6) + ', ' + position.y.toFixed(6) + ', ' + position.z.toFixed(6) + '));\n';
    result += '  theta = clamp(acos(dp), 0.0, ' + Math.PI.toFixed(6) + ');';
    result += '  reflection += light_' + i + '_' + octave + '(theta) * ' + light.power.toFixed(6) + ' * vec3(' + light.color.r.toFixed(6) + ', ' + light.color.g.toFixed(6) + ', ' + light.color.b.toFixed(6) + ') * vec3(' + reflectionColor.r.toFixed(6) + ', ' + reflectionColor.g.toFixed(6) + ', ' + reflectionColor.b.toFixed(6) + ');';
  }
  return result;
};

