materials.buildFragmentHeader = function(params) {
  var result = '';
  if (POST_PROCESSING) {
    result += 'uniform float fTime;\n';
    result += 'float nrand(vec2 n) {\n';
    result += '  return fract(sin(dot(n.xy, vec2(12.9898, 78.233))) * 43758.5453);\n';
    result += '}\n';

    result += 'float n2rand_faster( vec2 n ) {\n';
    result += '  float t = fract( fTime );\n';
    result += '  float nrnd0 = nrand( n + 0.07 * t );\n';
    result += '  float orig = nrnd0 * 2.0 - 1.0;\n';
    result += '  nrnd0 = orig * inversesqrt(abs(orig));\n';
    result += '  nrnd0 = max(-1.0, nrnd0);\n';
    result += '  nrnd0 = nrnd0 - sign(orig) + 0.5;\n';
    result += '  return nrnd0;\n';
    result += '}\n';

  }
  if (params.type == 1 || params.type == materials.OCEAN) {
    result += 'vec3 mod289(vec3 x) {\n';
    result += '  return x - floor(x * (1.0 / 289.0)) * 289.0;\n';
    result += '}\n';
    result += '\n';
    result += 'vec4 mod289(vec4 x) {\n';
    result += '  return x - floor(x * (1.0 / 289.0)) * 289.0;\n';
    result += '}\n';
    result += '\n';
    result += 'vec4 permute(vec4 x) {\n';
    result += '     return mod289(((x*34.0)+1.0)*x);\n';
    result += '}\n';
    result += '\n';
    result += 'vec4 taylorInvSqrt(vec4 r)\n';
    result += '{\n';
    result += '  return 1.79284291400159 - 0.85373472095314 * r;\n';
    result += '}\n';
    result += '\n';
    result += 'float snoise(vec3 v)\n';
    result += '  { \n';
    result += '  const vec2  C = vec2(1.0/6.0, 1.0/3.0) ;\n';
    result += '  const vec4  D = vec4(0.0, 0.5, 1.0, 2.0);\n';
    result += '\n';
    result += '// First corner\n';
    result += '  vec3 i  = floor(v + dot(v, C.yyy) );\n';
    result += '  vec3 x0 =   v - i + dot(i, C.xxx) ;\n';
    result += '\n';
    result += '// Other corners\n';
    result += '  vec3 g = step(x0.yzx, x0.xyz);\n';
    result += '  vec3 l = 1.0 - g;\n';
    result += '  vec3 i1 = min( g.xyz, l.zxy );\n';
    result += '  vec3 i2 = max( g.xyz, l.zxy );\n';
    result += '\n';
    result += '  //   x0 = x0 - 0.0 + 0.0 * C.xxx;\n';
    result += '  //   x1 = x0 - i1  + 1.0 * C.xxx;\n';
    result += '  //   x2 = x0 - i2  + 2.0 * C.xxx;\n';
    result += '  //   x3 = x0 - 1.0 + 3.0 * C.xxx;\n';
    result += '  vec3 x1 = x0 - i1 + C.xxx;\n';
    result += '  vec3 x2 = x0 - i2 + C.yyy; // 2.0*C.x = 1/3 = C.y\n';
    result += '  vec3 x3 = x0 - D.yyy;      // -1.0+3.0*C.x = -0.5 = -D.y\n';
    result += '\n';
    result += '// Permutations\n';
    result += '  i = mod289(i); \n';
    result += '  vec4 p = permute( permute( permute( \n';
    result += '             i.z + vec4(0.0, i1.z, i2.z, 1.0 ))\n';
    result += '           + i.y + vec4(0.0, i1.y, i2.y, 1.0 )) \n';
    result += '           + i.x + vec4(0.0, i1.x, i2.x, 1.0 ));\n';
    result += '\n';
    result += '// Gradients: 7x7 points over a square, mapped onto an octahedron.\n';
    result += '// The ring size 17*17 = 289 is close to a multiple of 49 (49*6 = 294)\n';
    result += '  float n_ = 0.142857142857; // 1.0/7.0\n';
    result += '  vec3  ns = n_ * D.wyz - D.xzx;\n';
    result += '\n';
    result += '  vec4 j = p - 49.0 * floor(p * ns.z * ns.z);  //  mod(p,7*7)\n';
    result += '\n';
    result += '  vec4 x_ = floor(j * ns.z);\n';
    result += '  vec4 y_ = floor(j - 7.0 * x_ );    // mod(j,N)\n';
    result += '\n';
    result += '  vec4 x = x_ *ns.x + ns.yyyy;\n';
    result += '  vec4 y = y_ *ns.x + ns.yyyy;\n';
    result += '  vec4 h = 1.0 - abs(x) - abs(y);\n';
    result += '\n';
    result += '  vec4 b0 = vec4( x.xy, y.xy );\n';
    result += '  vec4 b1 = vec4( x.zw, y.zw );\n';
    result += '\n';
    result += '  //vec4 s0 = vec4(lessThan(b0,0.0))*2.0 - 1.0;\n';
    result += '  //vec4 s1 = vec4(lessThan(b1,0.0))*2.0 - 1.0;\n';
    result += '  vec4 s0 = floor(b0)*2.0 + 1.0;\n';
    result += '  vec4 s1 = floor(b1)*2.0 + 1.0;\n';
    result += '  vec4 sh = -step(h, vec4(0.0));\n';
    result += '\n';
    result += '  vec4 a0 = b0.xzyw + s0.xzyw*sh.xxyy ;\n';
    result += '  vec4 a1 = b1.xzyw + s1.xzyw*sh.zzww ;\n';
    result += '\n';
    result += '  vec3 p0 = vec3(a0.xy,h.x);\n';
    result += '  vec3 p1 = vec3(a0.zw,h.y);\n';
    result += '  vec3 p2 = vec3(a1.xy,h.z);\n';
    result += '  vec3 p3 = vec3(a1.zw,h.w);\n';
    result += '\n';
    result += '//Normalise gradients\n';
    result += '  vec4 norm = taylorInvSqrt(vec4(dot(p0,p0), dot(p1,p1), dot(p2, p2), dot(p3,p3)));\n';
    result += '  p0 *= norm.x;\n';
    result += '  p1 *= norm.y;\n';
    result += '  p2 *= norm.z;\n';
    result += '  p3 *= norm.w;\n';
    result += '\n';
    result += '// Mix final noise value\n';
    result += '  vec4 m = max(0.6 - vec4(dot(x0,x0), dot(x1,x1), dot(x2,x2), dot(x3,x3)), 0.0);\n';
    result += '  m = m * m;\n';
    result += '  return 42.0 * dot( m*m, vec4( dot(p0,x0), dot(p1,x1), \n';
    result += '                                dot(p2,x2), dot(p3,x3) ) );\n';
    result += '  }\n';
  }

  if (params.type == 0) {

    // implement cRefract
    //     k = 1.0 - eta * eta * (1.0 - dot(N, I) * dot(N, I));
    // if (k < 0.0)
    //     R = genType(0.0);       // or genDType(0.0)
    // else
    //     R = eta * I - (eta * dot(N, I) + sqrt(k)) * N;
    result += 'vec3 cRefract(vec3 I, vec3 N, float eta) {\n';
    result += '  float k = 1.0 - eta * eta * (1.0 - dot(N, I) * dot(N, I));\n';
    result += '  return eta * I - (eta * dot(N, I) + sqrt(min(k, 0.0))) * N;\n';
    result += '}\n';



    result += 'uniform sampler2D uScreen;\n';
    result += 'varying vec3 vU0;\n';
    result += 'varying vec3 vV0;\n';
    result += 'varying vec3 vW0;\n';
  }
  if (params.type == materials.GC_MATERIAL) {
    result += 'uniform sampler2D uNormal;\n';
    result += 'uniform sampler2D uAO;\n';
    result += 'varying vec2 vUV;\n';
    result += 'varying vec3 vU0;\n';
    result += 'varying vec3 vV0;\n';
    result += 'varying vec3 vW0;\n';
  }
  result += 'varying vec3 vPos;\n';
  if (POST_PROCESSING) {
    result += 'varying vec4 vSPos;\n';
  }
  result += 'varying vec3 vNormal;\n';
  result += 'varying vec3 I;\n';
  result += 'vec3 gc = vec3(' + (materials.gammaCorrection * materials.colorspaceCorrection).toFixed(6) + ');\n';

  for (var i = 0; i < environment.length; i++) {
    var light = environment[i];
    for (var octave in light.patches) {
      result += light.patches[octave];
    }
  }
  return result;
}

materials.buildVertexHeader = function(params) {
  var result = '';
  result += 'varying vec3 vPos;\n';
  if (POST_PROCESSING) {
    result += 'varying vec4 vSPos;\n';
  }
  result += 'varying vec3 vNormal;\n';
  result += 'varying vec3 I;\n';
  if (params.type == 0) {
    result += 'varying vec3 vU0;\n';
    result += 'varying vec3 vV0;\n';
    result += 'varying vec3 vW0;\n';
  }
  if (params.type == materials.GC_MATERIAL) {
    result += 'varying vec2 vUV;\n';
    result += 'varying vec3 vU0;\n';
    result += 'varying vec3 vV0;\n';
    result += 'varying vec3 vW0;\n';
  }
  return result;
}
